/* eslint-disable import/no-anonymous-default-export */
import Card04 from "../Header/Carroussel/Card04/Card04";

import img01 from "../../../src/Foto/img/Bariloche .jpg";
import img08 from "../../../src/Foto/img/buenos_aires.jpg";
import img09 from "../../../src/Foto/img/cancun.jpg";
import img10 from "../../../src/Foto/img/toquio.jpg";
import img11 from "../../../src/Foto/img/Dubai1.jpg";
import img02 from "../../../src/Foto/img/caribeHolandes.jpg";
import img03 from "../../../src/Foto/img/Madri.jpg";



export default () => {
    return(

<select className="internacional">
        <h3>Pacote de Viagem Internaconal</h3>

   <Card04 Foto={img01 }  ></Card04>
   <Card04 Foto={img08 }  ></Card04>
   <Card04 Foto={img09 }  ></Card04>
   <Card04 Foto={img10 }  ></Card04>
   <Card04 Foto={img11 }  ></Card04>
   <Card04 Foto={img02 }  ></Card04>
   <Card04 Foto={img03 }  ></Card04>
 

   </select>
    );
}
